import React from 'react';
import { Button, Modal } from 'react-bootstrap';

export default (props) => {
  return (
    <Modal
      {...props}
      size='lg'
      aria-labelledby='contained-modal-title-vcenter'
      centered
    >
      <Modal.Body>
        <div className='row'>
          <div className='col'>
            <h4>{props.name}</h4>
          </div>
          <div>
            <p>{props.email}</p>
            <p>tel.:{props.phone}</p>
            <p>{props.website}</p>
          </div>
        </div>
        <p>User Address:</p>
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={props.onHide}>Close</Button>
      </Modal.Footer>
    </Modal>
  );
}
;
